SET Nguoisua=${req.body.Nguoisua},Ngaysua='${req.body.Ngaysua},TrangThai=1'
WHERE ID_SV_MH='${req.body.ID_SV_MH}' and ID_Loaidiem='${req.body.ID_Loaidiem}'`, function (err, profileset) {
